import React from 'react';
import './menu.css'
import dishes from '../../dishes'
import Row from "react-bootstrap";

const Menu = () => {
    return (
        <Row>
            {
                dishes.map((dish)=>(
                    <Col lg={3}>
                        {dish.name}
                    </Col>
                ))
            }
        </Row>
    );
};

export default Menu;
